// @mui material components
import Card from "@mui/material/Card";
import Grid from "@mui/material/Grid";
// Soft UI Dashboard PRO React components
import SuiBox from "components/SuiBox";
import SuiTypography from "components/SuiTypography";

// Soft UI Dashboard PRO React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import Footer from "examples/Footer";
import SalesTable from "examples/Tables/SalesTable";
import salesTableDataElss from "layouts/dashboards/default/data/salesTableDataElss";
import salesTableDataElss1 from "layouts/dashboards/default/data/salesTableDataElss1";

function Referral() {


    return (
        <DashboardLayout>
            <DashboardNavbar />
            <SuiBox my={3}>

                <SuiBox mb={5}>
                    <Grid container spacing={3} alignItems="center">
                        <Grid item xs={12} lg={6}>
                            <SuiTypography variant="h4" fontWeight="medium">
                                ELSS Opportunity Report
                            </SuiTypography>
                        </Grid>
                    </Grid>
                </SuiBox>

                <Card>
                    <SuiBox pt={3} px={3}>
                        <SuiTypography variant="h6" fontWeight="medium">
                            *This report shows ELSS investment Opportunity available with all the KYC verified users who have invested less than 80C limit in current year till date.
                        </SuiTypography>
                    </SuiBox>
                    <SalesTable rows={salesTableDataElss} />
                </Card>
            </SuiBox>

            <SuiBox my={3}>
                <Card>
                    <SalesTable title=" Clients who have not invested in ELSS" rows={salesTableDataElss1} />
                </Card>
            </SuiBox>
            <Footer />
        </DashboardLayout>
    );
}

export default Referral;
